import { useEffect, useState } from 'react';

import Card from './Card';
import Navigation from './Navigation';
import Quotes from './Quotes';
import Search from './Search';

import '../CSS/LandingPage.css';

function LandingPage(){
	const [selectedCountry, setSelectedCountry] = useState([]);

	useEffect(()=>{console.log(selectedCountry)},[selectedCountry])
	return(
		<>
		<Navigation/>
              <Search setSelectedCountry ={setSelectedCountry} selectedCountry={selectedCountry}/>
              <div className='Card-Holder'>
                {selectedCountry.length === 0? <Card selectedCountry ={selectedCountry}/> : selectedCountry.map(country=><Card selectedCountry ={country} selectedCountryArr ={selectedCountry}/>)}

              </div>
              <Quotes/>
		</>

	);
}
export default LandingPage;
